import React, { Component } from 'react'
import {Button} from 'antd'

export default class App extends Component {
  render() {
    return (
      <div>
        App
        <button>点我</button>
        <Button type="primary">按钮1</Button>
        <Button type="primary">Primary Button</Button>
        <Button type="primary">Primary Button</Button>
        <Button type="primary">Primary Button</Button>
      </div>
    )
  }
}
